import React from 'react';
import './App.css';
import TextField from '@material-ui/core/TextField';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Hello World!</p>
        <form noValidate autoComplete="off">
          <TextField id="standard-basic" label="Insert Text" />
        </form>
      </header>
    </div>
  );
}

export default App;
